import React from "react";
import AdminDashboard from "../components/admin/AdminDashboard";

function AdminScreen() {
  return (
    <div class="container-fluid ">
      <div class="row flex-nowrap">
        <AdminDashboard />
      </div>
    </div>
  );
}

export default AdminScreen;
